-- ***************************************************
-- Create Store Procedure
-- ***************************************************

IF EXISTS (SELECT name, type_desc, type
    FROM sys.procedures WITH(NOLOCK)
    WHERE NAME = 'uspGetDataCurves'
    AND type = 'P')
DROP PROCEDURE [dbo].[uspGetDataCurves]
GO
CREATE PROCEDURE [dbo].[uspGetDataCurves]
	@sex tinyint,
	@chartTypeZ bit,
	@chartIndicator tinyint
AS
SET NOCOUNT ON;
DECLARE @cols varchar(50) = 'SD3neg, SD2neg, SD1neg, SD0, SD1, SD2, SD3';
DECLARE @tableName varchar(50) = 'LengthHeightForAge';

IF      (@chartIndicator = 1) 
	BEGIN
		SET @tableName = 'LengthHeightForAge'
		SET @cols = 'SD3neg, SD2neg, SD0, SD2, SD3';
	END;
ELSE IF (@chartIndicator = 2) 
	BEGIN
		SET @tableName = 'WeightForAge';
		SET @cols = 'SD3neg, SD2neg, SD0, SD2, SD3';
	END;
ELSE IF (@chartIndicator = 3) SET @tableName = 'WeightForLength';
ELSE IF (@chartIndicator = 4) SET @tableName = 'WeightForHeight';
ELSE IF (@chartIndicator = 5) SET @tableName = 'BMIForAge';
ELSE IF (@chartIndicator = 6) SET @tableName = 'HCForAge';
ELSE IF (@chartIndicator = 7) SET @tableName = 'MUACForAge';
ELSE IF (@chartIndicator = 8) SET @tableName = 'SSFForAge';
ELSE IF (@chartIndicator = 9) SET @tableName = 'TSFForAge';
	
IF (@chartTypeZ = 1)
	BEGIN
		EXEC('SELECT ' + @cols +
			' FROM ' + @tableName +
			' WHERE Sex = ' + @sex +
			' ORDER BY ROW_NUMBER() over (ORDER BY sex)');
	END;
ELSE
	BEGIN
		EXEC('SELECT P3, P15, P50, P85, P97 ' +
			' FROM ' + @tableName +
			' WHERE Sex = ' + @sex +
			' ORDER BY ROW_NUMBER() over (ORDER BY sex)');
	END;
GO

